import React, { useState, useEffect } from 'react';
import { Plus, Search } from 'react-feather';
import settingImage from './settingimage.jpg';

const TaskManager = () => {
  const [timer, setTimer] = useState(0);
  const [isRunning, setIsRunning] = useState(false);

  useEffect(() => {
    let interval;
    if (isRunning) {
      interval = setInterval(() => {
        setTimer(prevTimer => prevTimer + 1);
      }, 1000);
    }
    return () => clearInterval(interval); // Cleanup interval on component unmount or when isRunning changes
  }, [isRunning]);

  const handleStart = () => {
    setIsRunning(true);
  };

  const handleStop = () => {
    setIsRunning(false);
  };

  const formatTime = (time) => {
    const hours = String(Math.floor(time / 3600)).padStart(2, '0');
    const minutes = String(Math.floor((time % 3600) / 60)).padStart(2, '0');
    const seconds = String(time % 60).padStart(2, '0');
    return `${hours}:${minutes}:${seconds}`;
  };

  return (
    <div style={styles.container}>
      <nav style={styles.nav}>
        {/* Navigation */}
      </nav>

      <div style={styles.content}>
        {/* Task Section */}
        <div style={styles.timeSection}>
          <div style={styles.timeControls}>
            <div style={styles.timer}>{formatTime(timer)}</div>
            <div style={styles.timeButtons}>
              <button style={styles.timeButton} onClick={handleStart}>TIME START</button>
              <button style={styles.timeButton} onClick={handleStop}>TIME END</button>
            </div>
          </div>

          {/* Form and Time Blocks */}
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    minHeight: '100vh',
    backgroundColor: '#f5f5f5',
